                  >
                    New and Enhanced Gages
                  </h3>
                </div>
                <div
                  id="p-container-new_enhanced"
                  class="p-container"
                >
                  <p>Measurements of real-time flow levels are critical to the decision makers of the Basin, especially in the River Masterâ€™s office during late-summer low flows. To better understand streamflow in the basin and inform release decisions from reservoirs, 94 new or enhanced stream gages have been installed the last three years, each housing delicate monitoring equipment that is collecting data all day, every day.</p>
                  <p>Not only can scientists receive near real-time measurements from the field with minimal delay, technicians can also change the timing and duration of data collection from a remote location, which allows for good data collection even during extreme weather events.</p>
                </div>
              </div>
