                    Research and Development 
                  </h3>
                </div>
                <div class="subtext-text-container">
                  <div
                    id="p-container-r-d"
                    class="p-container"
                  >
                    <p>USGS field staff collect water-quality data using an autonomous underwater vehicle (AUV) - a programmable underwater robot. The AUVâ€™s back-and-forth scanning of the lower waters of the Basin provides data that can be used to build maps of how water quality changes through the 3D space of the Delaware Bay.</p>
                    <p id="p-cameras">
                      In addition, new cameras that are connected to a near real-time image delivery system were installed at 9 strategic locations in the DRB. These cameras open up the potential for new realms of science and data processing for flow measurement, and support USGS visually sharing the dynamic lives of rivers and streams.
                    </p>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div class="text-content-side text-chunk">
            <h3>A New Generation of Water Science in the Delaware River Basin</h3>
            <p>Water uses in the Delaware Basin are diverse and complicated, and the need for information that describes the present and future conditions of water availability and water quality are more pressing than ever.</p>
            <p>The advancements in water science and monitoring paint a clearer picture of how the DRB has changed, and new efforts are building models that better predict the health and function of the river in the future. As a result, the new advanced monitoring strategy of the NGWOS is enhancing water data collection, and the modernized data management â€“ with increased public availability, rapid data downloads, and interactive views of current conditions â€“ makes it easier to study the health of Basin.</p>
            <p>While this story focused on flow, salinity, and water temperature, the USGS and collaborators study a multitude of other water-quality factors in the Basin.  We could tell additional stories about sediment, turbidity, nutrients, dissolved oxygen, pathogens, heavy metals, and chemical contaminants.</p>
            <p>With all these aspects of a healthy river basin, monitoring and modeling enables wiser management decisions, a more optimal balance of water uses, and a richer understanding of this beautiful and life-sustaining river.</p>
