// This section controls layout, grid pattern

/// Parent Container
#monitoring-container{
  display: grid;
  grid-template-columns: 1fr 1fr;
}

@media only screen and (max-width: 992px) {
  #monitoring-container {
    grid-template-columns: 1fr;
    justify-items: center;
  }
}

// Image Container

#image-container {
  align-self: start;
  object-fit: cover;
  height: 100vh;
  min-width: 2000px;
  position: sticky;
  display: block;
  top: 0;
  z-index: -1;

  }

  @media only screen and (max-width: 992px) {
    #image-container {
      min-width: 1200px;
    }


  @media only screen and (max-width: 600px) {
    #image-container {
      min-width: 900px;
    }
  }
    
  .inking {
    position: relative;
    display: inline-block;
    text-align: left;
    width: 100%;
    top: 0;
    z-index: -1;

    svg {
      position: absolute;
      display: inline-block;
      height: auto;
      width: 100%;
      left: 0;
    }
  }
}

